  input: 'TEXT,"F3A","","Carne for Congress Committee - FEC ID No. C00374421.  I am
    filing an amendment to the Pre-Primary FEC Disclosure Form 3 for the period 4/1/02
    to 4/17/02 for two reasons.  The first reason is to correct and erroneously transmitted
    amendment to the Pre-Primary Report (amendment assigned FEC No. 34733).  The second
    reason is to report transactions discovered after the 4/25/02 filing deadline
    that occurred prior to the end of the reporting period (I.e., an uncashed check
    and a bank service charge).  As for the first reason for the amendment, the Pre-Primary
    Report was correctly transmitted on April 25, 2002 (assigned FEC No. 34806).  Unfortunately,
    on that same day, a report designated as an amendment to the Pre-Preliminary Report
    was erroneously transmitted to the FEC (assigned FEC No. 34733) by virtue of a
    clerical error.  This report (FEC No. 34733) is an errant document that was incorrectly
    transmitted to the FEC.  As such, I am amending it to correspond with the correct
    report (I.e. FEC No. 34806) with the two exceptions that constitute the second
    reason for the amendment:  1) the reduction of unitemized disbursements in the
    amount of $15.00 to account for the fact that a check was returned to me, uncashed,
    after the 4/25/02 deadline, for an expense reported on the Pre-Primary Report;
    and 2) an increase in unitemized disbursements in the amount of $24.25 to account
    for the fact that, after the 4/25/02 filing deadline, I learned of a bank charge
    in this amount which was debited during the Pre-Primary Report period.  As such,
    this amendment shows an increase in unitemized disbursements in the amount of
    $9.25 over the amount shown in the correct Pre-Primary Report (FEC No. 34806).  Please
    contact me if you have any questions or require anything else.  Otherwise, I will
    assume that you have no further concerns with respect to these issues.  Your attention
    to this matter is appreciated."'
